import React from 'react';

// This function takes a component...
const wrapperComponentMethod = (
  WrappedComponent1: React.FC,
  WrappedComponent2: React.FC
) => () => (
  <>
    <WrappedComponent1 />
    <WrappedComponent2 />
  </>
);

export default wrapperComponentMethod;
